import React from 'react'

import './Menu.css';

import { useState } from 'react';

function Menu(props) {
    //props.onClickNav();
    //여기서 STATE를 만들고
    const [menuNum, setmenuNum] = useState("-1");
    const {onClickNav, Address, Content} = props;

    return (
        <button onClick = {() => props.onClickNav(Content)}>
            <a href={Address}>
                <div>
                    {Content}
                </div>
            </a>
        </button>
    )
}

export default Menu
